(4, 'Divinity: Original Sin 2', 'The eagerly anticipated sequel to the award-winning RPG. Gather your party. Master deep, tactical combat. Join up to 3 other players - but know that only one of you will have the chance to become a God.', 'assets/images/games/4.jpg', '1.0', 10, 1, '2017-09-17', 356, 42.5),
(5, 'Heroes of Might and Magic® III Complete', 'Murder, treachery, resurrection, savage battles and ultimately-freedom!\r\nWhen Erathia\'s King Gryphonheart is murdered by traitors he is resurrected as an undead warlord who leads a ruthless invasion of his former Kingdom.', 'assets/images/games/5.jpg', '1.0', 10, 1, '1999-03-03', 0.9, 6),
