(7, 'Heroes of Might and Magic® V Bundle', 'Heroes of Might and Magic® 5 is a turn-based strategy game in which you can build cities and besiege them, train troops and slaughter them, and explore new lands – and crush them under your iron heel.', 'assets/images/games/7.jpg', '1.0', 0, 0, '2006-05-16', 4.2, 10),
(8, 'The Walking Dead: Season 1', 'The Walking Dead is a five-part game series set in the same universe as Robert Kirkman’s award-winning comic book series. Play as Lee Everett, a convicted criminal, who has been given a second chance at life in a world devastated by the undead.', 'assets/images/games/8.jpg', '1.0', 0, 0, '2012-04-24', 3.4, 22),
