(10, 'Ultimate DOOM', 'In the future, humans have left Earth and settled throughout the galaxy. On Mars, the Union Aerospace Corporation has established a radioactive waste facility and allowed the military to conduct teleportation experiments on the nearby moons of Deimos and ', 'assets/images/games/10.jpg', '1.0', 0, 0, '1995-04-30', 50, 5),
(11, 'Cuphead', 'Cuphead is a classic run and gun action game heavily focused on boss battles. Inspired by cartoons of the 1930s', 'assets/images/games/11.jpg', '1.0', 8, 1, '2017-09-07', 575, 9),
(12, 'Rocket League®', 'Soccer meets driving once again in the long-awaited, physics-based multiplayer-focused sequel to Supersonic Acrobatic Rocket-Powered Battle-Cars! Choose a variety of high-flying vehicles equipped with huge rocket boosters to score amazing aerial goals and', 'assets/images/games/12.jpg', '1.0', 5, 1, '2015-07-07', 5, 20),
(13, 'Witcher 2: Assassins Of Kings, The - Enhanced Edition', 'The second installment in the RPG saga about the Witcher, Geralt of Rivia. A new, modern game engine, responsible both for beautiful visuals and sophisticated game mechanics puts players in the most lively and believable world ever created in an RPG game.', 'assets/images/games/13.jpg', '1.0', 0, 0, '2012-04-17', 15.2, 18),
(14, 'The Witcher: Enhanced Edition', 'Your name is Geralt of Rivia and you are a witcher, that means you kill monsters for a living. You were given special training to be the best at what you do and your body has been enhanced with potent elixirs to help you do it.', 'assets/images/games/14.jpg', '1.0', 0, 0, '2007-10-26', 8.5, 8),
